webpackJsonp([0xd930b2679d9e],{5135:function(e,t){e.exports={data:{post:{html:'<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2000/09/expologo001.gif" height="141" width="140" border="0" alt="Expo Logo: " /></p>\n<p><b><i>The Expo was much better than we expected. As we drove home we decided to try for a second visit. Here for some first impressions:</i></p>\n<p>"plaza"</p>\n<p><i><b>Here\'s a shot of the famous Expo Plaza.</b></i></p>\n<p>"jerusalem"</p>\n<p><b><i>Here\'s a picture of our happy fmily at the Israel exhibit.</i></b></p>\n<p><i><b>We would have liked to have seen the Icelandic Exhibit. </b></i></p>\n<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2000/09/island.jpg" height="262" width="350" border="0" alt="Island: " /></p>\n<p><i><b>Unfortunately it was closed for maintenance when we stopped by the first time. I think one of the geysers was broken. When it was open again, we were on our way out and Christopher was desperate for his evening bottle!</b></i></b></p>',fields:{title:"Expo Day",date:"03 Sep 2000",url:"https://papascott.de/2000-09-03-expo-day/"}}},pathContext:{slug:"/2000-09-03-expo-day/",prev:{fields:{title:"Weekend off",date:"02 Sep 2000",slug:"/2000-09-02-weekend-off/"}},next:{fields:{title:"Christophers Guide to the Expo",date:"04 Sep 2000",slug:"/2000-09-04-christophers-guide-to-the-expo/"}}}}}});
